warfdump --uuid \"${HERMES_DSYM_PATH}\"\n    fi\n  else\n    echo \"Failed to generate Hermes dSYM\"\n  fi\nelse\n  echo \"dsymutil not found, cannot generate Hermes dSYM\"\nfi\n";
